script: |
  super -f text -I q9493.spq | sort > q9493.out

inputs:
  - name: q9493.spq
    data: |
      SELECT + 99 AS col2, - ( + 68 ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 * col1 + + + col1 IS NULL;
  - name: tab0

outputs:
  - name: q9493.out
    data: |
      99	-68
      99	-68
      99	-68
